import React from 'react';
import FormList from './components/FormList/FormList';

function App() {
  return (
    <div className="App">
      <div className="container">
          <nav style={{backgroundColor:"#58cef5"}} className="navbar navbar-light bg-light">
              Form Manager 
            </nav>
        <FormList></FormList>
      </div>
    </div>
  );
}

export default App;
